const Tab = () => {
  return (
    <ul class="nav nav-tabs">
      <li class="nav-item">
        <a class="nav-link active" href="#">
          Dashboard
        </a>
      </li>
      <li class="nav-item">
        <a class="nav-link" href="#">
          Playback
        </a>
      </li>
      <li class="nav-item">
        <a class="nav-link" href="#">
          Capture
        </a>
      </li>
    </ul>
  );
};

export default Tab;
